package tugas;

public class Aki {
	private double voltase;
	private double suhu;
	public Aki() {
		// TODO Auto-generated constructor stub
		this.voltase = 0;
		this.suhu = 0;
	}
	//setter 
	public void setVoltase(double voltase) {
		this.voltase = voltase;
	}
	public void setSuhu(double suhu) {
		this.suhu = suhu;
	}
	//getter 
	public double getVoltase() {
		return this.voltase;
	}
	public double getSuhu(){
		return this.suhu;
	}
	
	
}
